rotations["chickengame_nnaaaz"]	= Rotation:New({desc = "Nnaaaz's Chicken Puzzle maps", shamans = 0, autoskip = false, is_random = false, items = game_maps})



if __IS_MAIN_MODULE__ then
	eventPlayerWon = function()
		tfm.exec.newGame()
	end
	local playing_player = nil
	eventPlayerBonusGrabbed = function(player_name, id)
		if not playing_player then
			playing_player = player_name
			for other_player_name in pairs(tfm.get.room.playerList) do
				if other_player_name ~= player_name then
					tfm.exec.freezePlayer(other_player_name, true, false)
				end
			end
			local sync_player = tfm.exec.getPlayerSync()
			if sync_player ~= nil and sync_player ~= player_name then
				tfm.exec.setPlayerSync(player_name)
			end
		elseif player_name ~= playing_player then
			return false
		end
	end
	eventNewGame = function()
		playing_player = nil
	end
end



function eventInit()
	if __IS_MAIN_MODULE__ then
		tfm.exec.disableAfkDeath()
		tfm.exec.disableAutoNewGame()
		tfm.exec.disableAutoTimeLeft()
		tfm.exec.disablePhysicalConsumables()
		newgame.SetRotation("chickengame_nnaaaz")
		tfm.exec.newGame()
		tfm.exec.chatMessage("===")
		tfm.exec.chatMessage("<b><o>This game is singleplayer!</o></b>")
		tfm.exec.chatMessage("<b><o>Every round, the first player to press a button is set as sync and others are killed.</o></b>")
		tfm.exec.chatMessage("<j>Help the chicken to return to its eggs.</j>")
		tfm.exec.chatMessage("<j>The game's concept is from Nnaaaz, this script is for testing the maps I made (10 in total).</j>")
		tfm.exec.chatMessage("<ch>Use <ch2>!replay</ch2> to retry the map and <ch2>!skip</ch2> to skip the level.</ch>")
		tfm.exec.chatMessage("<ch>Use <ch2>!admin</ch2> to allow a player to use every command.</ch>")
		if room.is_tribehouse then
			tfm.exec.chatMessage("<ch>Hide this text with <ch2>!chat</ch2>.</ch>")
		end
		tfm.exec.chatMessage("===")
	end
end
